import React from "react";
import { createContext, useState } from "react";
import App from "../App";
import Mode from "../Data/Model/Mode";

export const DataContext = createContext(Mode.dark);

export const DataProvider = (props) => {
  const [dark, setDark] = useState({});

  return (
    <DataContext.Provider value={[dark, setDark]}>
      <App />
    </DataContext.Provider>
  );
};
